content.css:
.info-container {
  height: 100%;
}
.info-message {
  vertical-align: middle;
  position: relative;
  top: 50%;
  transform: translateY(-50%);
  text-align: center;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 14px;
  padding: 10px;
}
.loader {
  border: 5px solid #d5d6d8;
  border-radius: 50%;
  border-top: 5px solid #555;
  width: 20px;
  height: 20px;
  display: inline-block;
  -webkit-animation: spin 1s linear infinite;
  animation: spin 1s linear infinite;
}
/* Safari */
@-webkit-keyframes spin {
  0% {
    -webkit-transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(360deg);
  }
}
@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.error-indicator {
  width: 35px;
  height: 35px;
  display: inline-block;
}
.vbi-logo {
  width: 35vh;
  height: 13vh;
  max-width: 93px;
  max-height: 30px;
}
.vbi-logo-gray {
  background-image: url('data:image/png;base64,');
}
.vbi-logo-color {
  background-image: url('data:image/png;base64,');
}
.background-image {
  background-repeat: no-repeat;
  background-size: contain;
}
.editor-icon {
  top: 0px !important;
  width: 26px;
  height: 26px;
  border-radius: 50%;
  margin-bottom: 10px;
  background-color: #f2c811;
  opacity: 0.8;
}
.editor-icon:hover {
  -webkit-box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
  -moz-box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
  box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
  opacity: 1;
}
.editor-icon img {
  border-style: none;
  width: 13px;
  position: relative;
  top: 2px;
  left: 7px;
}
.close-icon .edit-icon-img {
  display: none !important;
}
.edit-icon .close-icon-img {
  display: none !important;
}
.modal-close-button {
  height: 13px;
  width: 12px;
  right: 4px;
  position: absolute;
  top: 2px;
  z-index: 60;
}
